import React from "react";

function About() {
  return (
    <>
      <section className="about-page">


        <section className="abouting">
          <div className="about-logo">
          <div className="conatiner-fluid">
            <div className="about-pic"></div>
          </div>
        </div>
         </section>

         .abouting
       
      </section>
    </>
  );
}

export default About;
